import { Link } from 'react-router-dom';


const Navbar = ({ isLoggedIn, onLogout, userType }) => {
  console.log("NAV");
    console.log(isLoggedIn);
    // Conditionally render the button only if not on the CustomerLogin page
    
    return (
      <div className='Navbar'>
      <div>
          {isLoggedIn ? (
              <div>
                <Link to ="/">
                  <button onClick = {onLogout}> Logout </button>
                </Link>

                {userType==="Customer"? (
                  <div>
                      <Link to ="/CustomerHomePage">
                        <button > Home </button>
                      </Link>

                  </div>
                ):(
                  <div>
                    <Link to ="/StaffHomePage">
                        <button > Home </button>
                    </Link>

                  </div>
                )}
                
              </div>
            ) : (
            <div>
              <Link to="/Login">LOGIN / REGISTER HERE</Link>
            </div>
            )}
        </div>

        <div>
          <Link to="/FlightSearch" LoggedIn = {isLoggedIn}> SEARCH FLIGHTS</Link>
        </div>

        <div>
          <Link to="/StatusSearch"> SEARCH FLIGHT STATUS</Link>
        </div>

      
        
      </div>
    );
    
  
    // If on the CustomerLogin page, don't render the button
    // return null;
  };

export default Navbar
